import React from 'react';
import PropTypes from 'prop-types';
import styles from './Content.module.scss';

const Content = ({ items: paragraphs }) => (
  <p className={styles['text-default']}>{paragraphs.map((text) => (<p key={text.substring(1, 6)} className={styles['paragraph-spacing']}>{text}</p>))}</p>
);

Content.propTypes = {
  items: PropTypes.arrayOf(PropTypes.string),
};

Content.defaultProps = {
  items: null,
};

export default Content;
